import React from 'react';
import Header from "./components/Header";
import './App.css';
import Nav from "./components/Navbar";
import Profile from "./components/Profile";

function App() {
    return (
        <div className="app-wrapper">
            <h1>This is react, baby!!!</h1>

            <Header/>

            <Nav/>

            <Profile/>


        </div>
    );
}

export default App;
